import React, { Component } from "react";
import StudentNavMenu from "./StudentNavMenu";
import { Accordion } from "react-bootstrap";
import StudentFormCard from "./StudentFormCard";

export default class Student extends Component {
  render() {
    return (
      <div className="student-container">
        <StudentNavMenu></StudentNavMenu>
        <div className="student-form-container ml-auto">
          <Accordion defaultActiveKey="0" className="sfc-accordion">
            <StudentFormCard
              id="0"
              componentName="Personal Information"
            ></StudentFormCard>
            <StudentFormCard
              id="1"
              componentName="Immediate Needs"
            ></StudentFormCard>
          </Accordion>
        </div>
      </div>
    );
  }
}
